import Row from "./Row";
import { render } from "react-dom";

export default function Table({ humans,renderHeader }) {
  return (
    <table>
        <tr>
            {renderHeader()}
        </tr>
      <tr>
        {humans.map(human => (
          <Row key={human.id} human={human} />
        ))}
      </tr>
    </table>
  );
}
